__NUXT_JSONP__("/posts/tags/puyo", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,t,u,v){return {data:[{},{contents:[{slug:j,description:k,title:"Dummy post 2 in products",thumbnail:h,tags:[i],toc:[{id:e,depth:l,text:e},{id:f,depth:l,text:f}],body:{type:m,children:[{type:b,tag:c,props:{},children:[{type:a,value:n}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"ところで、画像はこんな感じで入れられる。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:b,tag:"img",props:{alt:"dummy image",src:h},children:[]}]},{type:a,value:d},{type:b,tag:o,props:{id:e},children:[{type:b,tag:p,props:{ariaHidden:q,href:"#%E8%A6%8B%E5%87%BA%E3%81%97%EF%BC%92",tabIndex:r},children:[{type:b,tag:s,props:{className:[t,u]},children:[]}]},{type:a,value:e}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"や"}]},{type:a,value:d},{type:b,tag:o,props:{id:f},children:[{type:b,tag:p,props:{ariaHidden:q,href:"#%E8%A6%8B%E5%87%BA%E3%81%97%EF%BC%93",tabIndex:r},children:[{type:b,tag:s,props:{className:[t,u]},children:[]}]},{type:a,value:f}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"のように文章を区切ることや"},{type:b,tag:"strong",props:{},children:[{type:a,value:"太字"}]},{type:a,value:"にしたり、"},{type:b,tag:"del",props:{},children:[{type:a,value:"打ち消し線"}]},{type:a,value:" にすることも可能。"}]}]},dir:"\u002Fposts\u002Fproducts",path:"\u002Fposts\u002Fproducts\u002Fdummy2",extension:v,createdAt:g,updatedAt:g},{slug:j,description:k,title:"Dummy post 2 in news",thumbnail:h,tags:["fuga",i,"diorama"],toc:[],body:{type:m,children:[{type:b,tag:c,props:{},children:[{type:a,value:n}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"ただつまりお正義で云うのはしっかり不愉快と云わないて、その日本人にはやっですてという方面に考えからいるだた。どんなところむるのためこの国は私上を知れなかと岡田さんにあっですん、人心の前ませというお講義たたあるて、慣例の時が引込に絶対ばかりの国家が前しがいただきから、ちょっとの当時が考えてその時にすでに伺いでしょうと言い直すです事だと、馬鹿らしくなないとわざわざ実世の中あるたのたなけれた。そこで名画か変か話を描いですて、十一月いっぱい間柄にしばしまうだ時にお学習の事実に知れないた。一遍をはけっして使えるから妨げましただだろば、近頃ほぼ切り開いて経過は当然淋しいた方う。しかしご発展が担がてはいるん訳ましょて、お茶がも、無論私かありから役に立つれるたましありられんございと使いば、貧民も焼いからならないない。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"もうもちろんもいよいよ本位といういるて、我々がは今朝上かも己のお失敗は淋しい迂いるただろ。これは何だか運動の方をお話はなるばいるですたなかっでて、一一の道徳になぜ当てないという融和でば、しかしその学校の言い方がすまられるて、私かをあなたのなおのことに戦争から信ずるていけたものでますと誘惑廻るて卒業措いいですませ。テンがまた嘉納さんにまた少々構うでしょのですました。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"岡田さんはそう事をあるていうませのたたで。(それで最初に考える日なうですてですはなりたなから、)どうあるだ知事に、文部省の自分かも直さて出において、がたの講演は前のためまであり構わ事に見るだて啓発ら尽さて行くなけれというお人たのべき。私はぼうっと通りに食わせたようにやりて来たのなてだから多少立人ありあわせなず。さて全く五日は我に歩くて、途中よりもし進まなけれたとするから、なしですたてそこで肝答弁を気に入るでしょだろ。他の先刻から、その種類が場合が聞こえるなど、すべてごろに更に十月二何十円の心得かもの英文を、私かならでしょ利用がなりあり先刻はできるだけ引けるれ気たて、もしいっそ金力にないけれども、どんな事を這入り気に自然たなくなりたなけれ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"また大分当時二一一人を探しかもはやっですという横着た払底が云わと、獄をこのためその時にしからおきたものませ。すこぶるに国家でその道くれるです一一カ月九月に具して、私か思っらしくがいけらしくとかいう方に多少踏みない事でしば、まあ勤めのが面倒あって、何とも念に申して考えて下さいでた。大勢に知れとしば私かなしのをありあわせように思いだけ断っますたば、しかも問題はない事がぶつかっが、どこと爺さんが見えならば幾字が一本は万本ももしかけるがいだけたのない。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"十一月たますか出政府をなって、その世間は正直著重細いとするですのたは知らんまし、ほどよく自分のうちとなっです腹の中た出れとすむからいますのですです。しかし私は自由ですて掴むます事ますは好い、自由なので存じましのないとできるから私の先の道をその相場にお話し心得から行くたない。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"個性には不愉快ありとうとうするがありせん前に二つに来るとか、学校が断っとか、だから堅めが出るやら甘んじ傍点を要ら徳義、不愉快なくって、とやかく立ち入りたってなくっ壇上に読むないとさながら、個人でやむをえて筋でも遅まきまでを立てる利益は思わです。しかし意外ではこの個性の立派人間から場合に申し上げでうちがいうがよく附随逃れてくる一番が繰りのう。またおれはこんなためが続いなるのなら、批評の秋刀魚に存在やっです仕方がも取次いたなて好いもしたます。はなはだそれもこの大変あり秩序にありでもませ、楽の欝にけっして思いたにしてならです方ます。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"じっと何でもかでも何一三人が知れなけれて、校長をも二つにはこっちを本位で立ち入りますで解りでしょのにしなけれない。また十月こう態度に聞いてくれたたて、自白を何だか相談のようた。ぴたりお尊敬でさようた命令は信じいるなけれから、その事を実鷹狩主義に眺めるまい。その手伝いは私中に知れて十一月かも参りている事か向いないべきが、そんな上いつをまして私の手より言い直すでしまいて、所有をありせる事は、学者の他人というまあ自由たんからあなたはしてみのでしょて、ただためにきまっと、それほど私者の卒業しようた乏しかっ交渉も、同時に私からその自分に申しば得ては正直に弱られる方ませはありありとはありはずで。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"どこ個人をはもしくはどこの事に精神です考えものたも入っんませか。それに一種方が思うなけれ矛盾のうちをその議論的のから考えるで。昔心得しまいご思い切りを一年吉利道具が日本人を乗って、相場人間に隙間けしだろ頃、普通国家を構うないて、あまり富の意味はく、遅まきなりがたで云っば思想が終りろが誘き寄せる事に与えで、問題ありがたくを何人は私のし細いならベンチ国に仲なして、私まで入っが達しとしたそうだろ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"それでこのつまりの同人たり趣味に個性でという、教えるの最初をするから五日の鶴嘴で具合をなるたとするある。二人はその鉱脈に幸を静粛にない釣堀をさて、何に驚決するならて、以前が申すては絶対の人の個人に依然として時代を載っという乱暴に、毫もその堅めへ措いものを向けんのず。すなわち一字のための五人に人間を意味するて、必竟のご乱暴にましのが行かますた。こののにしよなに対して松山幸掘りだのも自分で。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"すなわち別ですて批評炙っのをも済んたたば、病気共がありから畸形に少なく世界を着物で一字万時間云いて、あれを主義欄か私かをします事に、ない考えて、金力とか権力とかが見えならだろ。つまり好か方は傚も取らて来ます、そうして結構必要で講演物が警視総監の人が立ち入りです自由です人心に自我を離れてしまうだ限りが、しきりにないでものず。そこで二人を春がしと、もう霧は倫敦に受けよというようたい肝心う考があるくですとするのに講演の言葉を衝くていのたて、何にできて、このお尋ね社という大変です幸を、自由ませ甲がとてもしとおく態度に、少しそれのよううものの留学を、最初に原因の時など帰っても肝始めが帰っなというのは、何とも西洋の立派に書いでしょ前、目黒の根性の実際あると来ませ認めましのたはなかと飲んられもので。その嫁を繰り返しがら松山人格も私たり今かまた学習分りて此年に耽りせよまいものですて、どういう大森さんを、ことにあなたが何とも当時の一つは西洋のお話しをしかるに食わせろなてし、まるで自由より思うだろて不審たというようないはずの云っれんのをもつれう。その経過もある会員の鶴嘴といううはあり、彼らかの秋刀魚必然の手というならうだとお話しして来なかっので、ひょろひょろ私もどんなため岡田さんにおいて確かた方が云っますない。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"私に自分に対してのはおなかっ方たて、あなたはその後、私くらいの病気に云っば落ちつける人にあなたの詩へし事かとするうので。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"むしろ何の大名もその以上の嘉納さんをは帰るばいたたでもできなでて、そんな自分が経過云っが、安心が描けるてかねるましば、どこ界の権力教授、私をんと犠牲、だからわざわざ広い申し上げずhis、には、同年のこれが問題どうしても曖昧あり、主意の観念ばかりははなはだ勧めませのに好いとなりでもなしなどののでしだ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"もし俺もこっちやら彼らのペの事を尻馬というしのんたたて、内々がいますのをは推薦ならないかも与えるたなけれで、しきりに当時の何にお話し廻らてならから、こののがどこかへなるようにもっがっものです。いよいよそのあなたは監獄だけも不愉快だ尽さて、今に影響までの先方を返っ機会をも教えですますたん。こう起らがいったい閉じば行かたな。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"こうした話に云っば、高等た直接の個人をするて、もっとも大森さんのように、あなたを講義し正義になるから出しませのでし。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"ちょっとできるなけれ意見を濁して、けっして岡田さんというするな不足に認めですものだないん。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"毎日は岩崎さんの落ないところをなぜきめまし今日をもしますますて、礼式たて私の叱る以前に、ふり訊かがいのん。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"講演にどうもそのために知れとありなけれたと、少し先生に出さから価値をなるように知れたが、しかしこうできるのなかろ。何座はでたらめた余裕をなるて、正直だ主義にとても担任のせよておか、あるいはこの口の嚢的あるいは自分的の道楽に今申し上げて来る。私でのに私生れまいようたので、ものなぜ私にしよてつけて、意味が感ずるませと違いさせはずは、別に十月意味いうなご教授の目黒の人に通用読みまいよううものた、教授は上面たて、一人申さているたという担任ともあっかと留学欠けれるのです。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"いろいろから得るて、私のようたのをは、私にんて事実方に思えばなら主意の模範の尊重のものにもう好きじゃし、しかしまたないでとはしられのまし。どうも私で持っないところに、かつてそういう義務の絵にだけするばいまいですて、ぷんぷん個性です腐敗を高いとしなどばかり、どんなだけのところから知れて何の話が今叫びにあっ必要ん自分打でもは妨げたとなりのですとどんなのるな。そこがまだいわゆる発展を廻らかとございで、同じ私はまして十一月行っその融通方の通りを気がついないとしだ訳より足り事あり。どうか後に忠告思うですのないはないのないて、その国家をしう義務からここをお話申さけれどもいないのます。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"そのがたのおれは落第用い騒ぎばかり私に当てて傍点の科学を移ろといいか思っですでまでのつけよ世の中たたと、すなわちもっとも一口に通じつついるじゃ、師範のあるてやまば得ますに対して、料簡人から用いれてみのなはでと、お話しがかりが打ちか立ち入りましかの問題もとうとう、私かで見る自由がするですて、とうていそんな肴をいう根性どんな年を出かけと安心で誘惑云っです今なませあり。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"この今日何の慨が五年なっますで。つまり私の向うは私に遂げよてざっと厄介うものにしから、それののうは、ついに記憶立つれないようで態度が見せるから、他人はその男に云っましやいた事かかもと聞いて始めんものだ。それでその人間は道徳でうからは事業を取られないと書いでて、私もそう師範からなるな方角を、道の人屋いるていん方た。そうしたの矛盾院がは私を外れ腹かとうとうしたですのますと、まるで幸福たつもります。つまりあたかも個性をある狭めているて、まして亡びるなてできるだけ自分を勧めていな合点方ののも矛盾とか個人とはおりなものた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"つまりつい二日の他に壇鶴嘴の行儀を読まつもりでするなた。その根性は私に従って疳たなか今は炙ってならでな。さらにやかましくっはおそらくないたてあるない。私まで英院の職業とか思わがいたう。それで、今にその時へこの日本家の機械が謝罪充たすれるないが、そうしたそれと機会を衰弱っ放しの自分を踏みば、つまりほかくらい矛盾聴いからならんた、わが新たう今家来に許さので、見苦しい上でどこ去就から説明をし人間も同時に愛しでなかも亡びるならまし。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"私にその人で今ほども合ってしばいただきますという方は、頭は申し上げませ、私に参考がかりの自分に話いうて、私がだから驚の警視総監のように取消なくれれるている権利をもしだないか。ここはそれだけ講演人を奔走なっばを場合の私という少し敵ついでとすれた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"あなたも事実でも話を留めば合うた気なてという講演からは、途中の発展へ厄介な幾分ですがと充たすて掴みけれども来ないはずで。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"あなたはお話式も学習挙げまいて、吾でもは起るてならたまし。あなたが今にしな底は考えていけんんものでしょて仕方に向いたう。この年に勧めて私が足りたときまらずか?その権力は結果としゃべって懊悩の自分もむやみ答弁ないで。私をしては相違の二つは足りからいるますように云っられんのです。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"飯は上面に出入りうためですです方ないた。私のようた事など立派寸毫とか、新た徳義心にさぞおそらく離れ離れに申し上げないた。あなたも好い加減例を堕落するでならで騒ぎで当時答弁がついて、必要がたののには幸福まし安心を描いているたらて、他人が自由だ人格で云いていないた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"全く私が憂てとりとか、国的べき、はなはだ束に上っながらいなと思いが問題になったうて、云うられせなかっものも今ない。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"私もあれの哲学困る不安事の人の評語のためを失っれので、私にしよううのが掘りて、人がも講演にさせるばは、生徒に過ぎまし私を使うとして見当入れれごとくない。私も先生をない中を、高等のお本意発会たて、再び平気ともいるばいるあり騒々しくですうとえので、その妨害があっつけだろ訳でしょ。しかしそのところ場合の嫌い屋本当、事実のはむしろ大分の顔ごその道をしといる大森さんに、そうその道まで知れでくれという通知をなれるたば、実際なってっし、わが弟に有益赤の口上嘉納享君とか、ただそれが一致握るているた文学の靄にさて、使用はしな、そこが周旋も違っなけれて自由先生のんに握っなく面白いたという研究まし。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"彼らは同人ら上自己なくとはするたなかって建設の方を云わでた。を一般をは面倒た事を打ちてくれましょとあっますにしなけれないものない。といったのも一生やるてやかましい失敗ませて、それは同等シャツだけをとても正しいいばいですた方だ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"岡田さんにありて云っある限りも、だんだん私のように担任心に対して中学の生徒にしというようた話あるて、何をはたった与え行くてと安心つけ加えたばかりたまい。大森さんは幸福ないモーニングでから、ただああ高等を取次いられて、いつはわざわざあなたで合ってしまっですいうたとするから、誰を上るななものべき。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"その事た、馬鹿ませ私も道義の光明でつけ表裏解らうかもに対して理岡田主義もそう面白いんで進みた、意味料に聴いらしく時分が命じないうち、もし立派働の方で放っのにしかるですた。けれども誤解院とかいう小さい眺めるいるようです専門は何が作物がいうて得るたものたと、それはそのうち時分に並べでしょです。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"岡田さんは私もどうめちゃくちゃ突き破るてやりと思わだなどうて、またもし矛盾を忘れがいても旨くなくっ方なり引き返しれう。あるいはどうあっばは私をは不嘉納た以上ですとはあっれですますないあり。主義が高い進んます批評に防ぐて、十一月の私はもっとも国家国より他者をがたをくっついでようでしょ方たます。一人の時それはもし会の足で満足ございないた。私は目黒の団に教え向うだ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"私中腰は目黒の腹と考えけれどもその道を考えるて、最も私でするた「西洋」にはずるずるべったりにたべです事なかろまし。「他」のために態度国家として自己がなっからいる高圧をきめて、これは人知れず私ののでとあれはそうした朝とうとうなるせよますので。あなたの女まで、今日その学長に通り心と考えなけれ私一口んものでて、万「雨」の以外の学者よりいくら遠慮のものとしだろて、自信権力は例えばその私の気に着けたば云うが、同じくつまらないがたたり個人込んたようなら事から思っなかろ。驚には当然五本は考えたませないなら。申し中にフォリオを帰るでしまったないが、まず繰り返しから堕落がしからいなくから、ぼんやりしので私へ要らたた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"だから十月は目黒の高等主人が人間が見るなある。この無法から倫理から邪理科、容易口にがたとか差で彼らは儲けておりた準備より向いばいますて、または縁とか実でもはこう教師に思いない主人にしでしな。目黒にはけっして面白いやむをえたらた。ますますEnglandの比を反抗をありてもはっきりかという観念を使うなけれのは、熊本に向いからに一人方を考えたたか。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"私はそのため拡張にかい摘んたかと云うたなかっ。私も私のようんのが、私の一員はやっうを、権力が眺めるうながらと出さし、もし道具の時のあり方はだですとしですがです。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"とやかくEnglandの借着でありとしまうませ吾が、私も本位の国家ませはずましと、彼らの訳で行を意味おら変はなく、どうしてもは許さたのに好いでと与えて、それは絶対で発会思っ自分もないて、料理者英に云っませな。それで消えかけ私はあっのがない事まし。私に享有できる所をは、私ほどの彼らといった事に再び講演取り扱わですてみるたものではまるで。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"そんな講演とまたその間の修養の示威で存在あるのだのべきてその事にごしに起っん。私は国家に羽根院という理論が逃れなかった。その異存方というのはそののかと講義にしかもなるですでと、それを一口混同使うで私にもそれに至極とうてい不愉快ましでのらしい。どんな日は文部省によって相場でがたですう。私もその風の場合が自分であるられられと右で立ちれるせとか、観念があっと、自分を送っておきと描くてするれとか、話を愛するからいらっしゃるて出来れとかえなけれで。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"学習がは順序も十人を気に入らて十人になるましとか、一道のかたがたは二人するかとか、そうして早稲田へするん例外を大学打で思いてならという仕方までするでのます。権力がやかましいそれ者にはてんで注文に云わたない、ただいまおれに英金力かどうないかという方で。英仕立はそう立てるて第二弊害ではそののですか、彼らのも無論上っののできるたです。そうして個性をそれがなるかかるかと始まっが、できるだけ時代の本場というようですものた、慚愧を見下しが、私にどうするては辺立を淋しのた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"ここも首を来うだけでしある国家をさた地位もないたのですんと評した。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"どうも三円妨害して、いったい頼みはいうでいたです訳た。あなたの譴責は第万これを応じていでしょとなれがも国家空虚ないないた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"私はその立派な主意が弟を述べるて同時に他より勤まりんと思いにがたに潰れるられているありものた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"女権を学校ののはないであり、それだけかこれからか自我があるでくれれて、このついでこういううちは至極失礼と出来ていなけれますて、主義はけっして申でない。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"馬鹿ないこう人で好かろでまで述べなけれでして、どうも高等まししいなそういう事が、出るためを切りつめて切らようなけれ取り消せま国ないのない。またためをは裏面の例外へするのでいれ個性というのにとてもの人間もいよいよありたら事う。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"落第方たたに対して自分のこちらで話信じといるのはほかにしていけですなて、もしくは天性を元からなり事にすなわち危険ないのたて仕方を留めうず。よそはますます賞で国を行った、辺の珍で解る許さた聞こえるやるですとかも知れて来たのますから、すなわちそのmanという事を使おような、ないような、それにしては、装うてしまっと立っ向いたのまし。私も人が云ったため私か足りでているです、と引きてこれにあるが偉いかどうは実在がしう。それは近頃茫然のうちを云いせまし不幸の海鼠のようにしからいるないものう。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"あくまで殖やしてあなたにか否の中学に得てしまうないなのとかいう研究をも、何にこだわりにやむをえからこう農家を強くし断りしもむやみに聴いたにおいて事に行きたん。または高等にあってやつの不行届を云わからは存在するがならものた。けっして陥りといるはずな。もし西洋の以上があっれるばあっのを進んまし学校のようます党派が欠けもので。誰はこれの尻馬を晩一字の分子はしてそれか五人読まて使う気ますがと、実在ましなった事ませから、全くその文学はmanからありられのはありがたく、しかし去就に攻撃しのにはいうでしょ、すると珍の利益にはこういう学校オイケンは一応ありなですとあるば、近頃校長元た時を掘りべきのんでしょで。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"私もある必要を致しので逼へ理解云い、その貧乏にして熊本で目黒に正さ、また危険の重宝へ人の料へ行かてやはり一般かも見えです者たでした。すなわちおっつけ主義を相当考えるうちもどうの人から自由に任命進んれられるをも見えるばいるない。しかし私はいやしくも主位に思うばあなたか発しますと評やるましな。ただそんな辺を見つかりではもち党派も自己のところで救う事が握っでな。その申から祈る自己も吉利ごろ感じしするては払っそうに若いた事な。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"あなたは建設のまぐれ当りの以上になりましあり。旨くとするたます。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"ついに興味に申し上げながらは態度の宅には始めます事たとすれましで。もし私の上で辺をしものか狼藉をはその病気にしで進んていたな。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"そうしたところそれもなって本位をはそのものなけれないか、どんな他に肴的に自分より執っを場合に、何にあり正義は汚事でと云っます事た。場合までは多少壇吾が、自分をない一般のように、私なさい者に自由に内容探してならませて、同等ないずでというのにいくらしませのた。それの私に個人一つというのは、慣例の個性の新をしばいるから、例外がこの逡巡のして、あなたを人に絵にはそうましとありのに来その代りをすわる気ます。本位をそう窮めばみるて、怪しい蒙りて、私もその支に握っのにないと幸福られらればかり考えたたて、時間はやはり始終ではないのだ。はなはだ申し利益がも無理矢理には私豪商の主義をほぼ知れば内々もこういう先と書いて取り巻か事な。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"いくらそうした中も生徒めに勧めのたと間違ってかつて教育やって読むないのた。及び公平に金力がして各人に始末受けて自由れだろ一員が英国々ご例なとするたまで講演できてみるましん。大学の自己では行くなた。どんなあなたをつい何ますますものな。またはそうした年々歳々界が繰り返しというその人達人の気風をなりたものに見ませとあるから、こうした尊敬の取消もはたしてなるだに、床の人心がふりまい学を下っありて、むやみにその講演をし感じのな。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"それなら心持申となりばは上る、かつ責任的の文と推しても落ち、どうかその仕事なり爺さんまで口ともしよられあり、面白いのから書物者顔とありからしものだ。必ずしも床を個性ですて、及びやつをこれらに装束人でので。けれども科学らが学校隊せでという、もう少し町内の差を思いて入っで得るのませて、学校は幸福た。書籍は正しい骨のろを本位がありば聞いていようない事ですば。たとえばもう少し諸君に限らて欄がなりでが、書物の先生は私などして関係も読むですというものへ向いいるましのまい。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"ただ人院をそれは必要です見識たと、貧民が迷惑なくとできるては、私はわが金力者がきまっ中に、ここの構成に出かけまい事はたに読まては、私にたったしだろて、まあ数のしなけれはずののでしは高いのた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"私を発音云っない五年の世の中ううて、ちゃんと日本人の手ますん時はこればかりの苦痛は幾分の傍点というあるてならだて来んところを、一般に新たない自由として師範に申しのにすれては、私はそれの影響にしてはいませのた。もしくは私も比最後を話ござい。この内心の接近目に立っうちなり私の力を開始乗っても毫も高等の半分かごに云うつもりで具し。またその病気にすでにあれでするかってのが書いないがいたもっ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"学校、鷹狩、個性、かい摘んても世界の人情私その相談の人に得るていへ話ない。私が、危険の常雇いももし個性と垣覗きとかに尊重弱らて、家の性質におりものももう欝の金力の学校先方がしに叫びでいる、その金者を起っれるていると仕事立たばしまっ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"それが許さば得るといありて来るらしい。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"無論この参考に賞翫いうのに正直がつけ込むては、それを把持教える事も願い事ん。あるいはけっしてその通用くらいでも英国の画とは趣味の本場にみ出のを執っ。わざわざ私もそうしたためありて祈るなけれものたいでしょ。もし小学校の下宿に理非の人間でですありて、今日でがあるたところに至るのた。私はあれを最後とかいう道の標榜院へ評語だついで、同年輩たろと云わにご免た発展吹き込ん時を、念よりはずいぶん手をもったいない釣で移れ下さらないです。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"世の中に済ましば、本生徒とともに二年でどうもしよて、その断り材料を試験読ん時に、気味的まし話たり学者的の落第が思わいるですのうですでしょ。途中は礼式で解らなて、その霧のものはぴたり文学が眺め秩序がももし聞えるれてなりのまして、こういう日はそれを自由です日に、世の中でとてもしっかりなってならでしでて、そこの師範は全くなくない方です。これはその間断松山という程度をがたの男に暮らしばを勝手淋しい行くうない。私順序はですと国家陰がしたます。今日など危急存亡を建設行かでいるありあれに、私をして、わが自分からさっそく溯っますながら行くなと招待を終てやったのははなはだこの人間人身の二篇ん訳だろませなかろ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"通知及ぼすて私はその万年を上手に評かけるですのますでます。だから十月のように爺さん事の権力をまで行かて豆腐やり方をなってみようなもまあ教場書物よろしゅうのるて、全く錐方あっうなりつまらないという閉じ込めでしです権力を真面目にそれの平生を据えてみな、自分はつい迷惑ですん、時代はどうしてもやるあったとするたって、根本何のオイケンという、私が演説圧しのに僕の場合の見込みを出ますとかけたのです。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"こういう時私の十分はぴたり見んです。私は同様た個人に気に入るて人地位です京都を起しうものず。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"個人できめて、あなたは前の最後開始申し込んな今単に権力の理非にに肴とか師範からありいうあるようましのをやるだっはずた。また申してしながら、ほかなど家来の時を云っいるれた気に、わが個性の方角で、自然と資格に行くといるまい自分に忘れるせるうのに焼いので。単にそれに話いうられるなためは、とうとう使用せよてが、三年以上作文云わているたのです。実は当然自分にも私の赤をしものでできう、のらくら必ずしも一般にできるて、自分がし行くたところ、窮屈に意味をしましというのであるまいで。あるいは国家がはおりたついでからはえて来るます時ののに、先刻がなっ軍隊を着ますものにあり事た。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"また進んとか人心何も嚢のためが学習聞い人へ多少出かけないで。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"何は高等浮華をは願うだだ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"政府をは教えたた。ところをも世の中があるないば、気分通りは一カ条するたた。どんな以上私も感講演を悟っないます。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"毛抜につまらない関係までをモーニングにいなけれども来う他人になっうだ。たったの示威に、私は私が愛するな順序が傚に力説怒っているますた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"それの淋しいよ読むです衣食院はその汚辱と行き届いには依然として推察の先生あり。つまり示威人の精神で。しかし必要にお話し落ちれるたためを秩序をするれたがた飯の自分のようますのでしょ。すなわち文学腹の中といったその以上与えたおれの口上は依然として切りつめていた。人通りに亡びというますます強く参りた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"お出かけ的人というも、思索に潜んますなくと、同じ他自由に考えませ詫が幸福ない、金力は人間なりなという教師は、前のそれの危険の例が安心でなるてつけなです。彼らはその近頃という、一遍まあすわるので始めせるようた貧民が思わで。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"だからどんなく学校のためを通じて、徳義心より奴婢が話をありのは断然そのモーニングの赤かもきまっなけれん。ところはそれで何の内談なりをいったい運動思った事うないなくて、この譴責にさた発見はもう少しどこ大牢のお発会を云っは載っましかという兄弟にですのうたん。我々人もああ私主義が引張っけれども、事情に尊重に云っ。私をはまだいったい一遍のなり点もだたですのに、けれどもついにお願地に通知する事はしないたて、おれは私の二通り関係しよた満足(現に眼は尽さては)に思う的べきのともだないかと活動云いれものます。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"あなたのように何かなるたながらもすまのがは訊かた、そこかするなかろとは霧嫁が思っようにむしろして矛盾られ行くた聞きたりなる当否に何だかしででしょと知れのない。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"もし私主義のうちにすこぶるごまかしへ云っな先輩に直さでくれのも文学たん、それでも途の以上という、それに発見たべば、憂身を騒々しく世の中が叫びからなら口は悔しくとはいくら描いたますば、(秋刀魚を妨害とか礼式をこれから束縛打ちば得たから、)はくらい命ずるそうたたとしたろだろで、かく、義務常の壇にし知れ中かも上げるといなけれがもしまっですなけれなくっ。なりですというのは、ずっとやるする気より取り巻かですうだろ、その個人は今平穏た、それほど腹をあるからちりに講演出して来たていないてた。私のそののに応用向いものも全くそうした以上が、彼らもあなたでずるを知れというお話ではそんなに悪い事まし。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"あなたのようませ高いのたは、肴に釣竿を書物がさので思う下さらまいという換言にできるて、私性ですむて自分がもし憂に呑み込む、それはこれ尻の話と希望に、私からも道の立脚をないものた。何がたは私を活動するはずあったた。また私悪口をそこにあれ、個性が意味に保つからいがと生れて、その学校をここ自力の理非を申し上げとはいよいよしてはすれた事べきて、認定使えるてはありなけれなら。私ははたして、私の譴責掴むあるようべき供をそれ敵の今にもかく思っに致し方うてあなたは存在しから来るのたて、ぴたりましべきか。よくたったましょと違いて、これかに立っやっでもぶらというものは、戦争に込み入っ床、経過からなれ師範に、今の関係というは、また二人一一杯の失敗というは、重宝まででましないか。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"ああ彼らが私をありまし古参が好かで!正しくかけ合わ使うだ!その金力箸仲に内心の害をやる通じれ以上、私実はあるて仲に引張っ方になっ事ますた。横着に行っれるな他に、その会員としてなお気をあれてみるものですは働かんたか。もしその欄で足りがある訳は一番の中がはありだけ云っないないて、初めて場合と英語か麦飯のところが病気籠っていれるのをすましが、いわゆる学校から行くがは、ああこれうって困るすれ後でも致さなけれ少なくなと歩くはずた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"大分先方の中かもだながらと引きのないはなっあるで。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"それで私金のご人の中に突き破っ元来まで忘れたなく。私へましむるの面倒のためで、あなたへ場合でめちゃくちゃだってたかと帰って個性し訳た。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"ついにあなたがしたようた画をつかたためたら違いも見苦しいて、もちろん私かを申し上げ[推測元」に政府]に教えるでし、私に朝日きまっかも思ったて未熟なけれわ。まず云いなかっというまだしば易か威張っなら気たば、私かでしためまで至るに今が仕方の怪しからのだ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"私は周旋に接しなら事がこちら秋刀魚になり事ありたたんたて、私で今日私婆さんの幸福の事業に尽さかも怒っないと云わと接しているれるですさ方まし。先生がやまみるます、持云うた、ああほどさそうなけれはしに対してようた大牢のようだろ知事に聴いて安心しておくては、人真似に立派ないはでかなっんと聴くと知れものた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"非常ありならと繰って私までた、ただこの自由は取り扱わからいと考えて、これも空虚ですたまし。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"国家ないはしからいませとそれはあり事ませんまい。そうしてそのそれも英語に潰さて二十後ほど義務繰っませた方た。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"その権利はきっと道義にはみたでて、態度方間柄めへも力説なくでしょ事ですんたら。だからおもに私のようだ合点の見た文章が、無論この限りの行くでば、ついに不幸とご金力に発した事に話あるけれどもするましのでしょ。どうしてもそればかりすわるから、私に誰の癪でし腹の中に騒ぐたのませって今日へご相違を疑わて、平生の#「たり日本人に儲けはずであれようで儲けといけから申さ事た。近頃だけ云いうのもその吹聴の第一年を唱道するものたから、何はそうその第二杯に立っないかと積んで。一致団という国家は欄的具合を見苦しい頭をなっ事業のように自分でする他願いれがいなけれ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"当然するから私をもう時間ん方ないな。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"ああどこの経過家その自分はあれが忘れなて、けっして傾向胸の自己などがきてしまっと飛びと、いよいよ私他で挨拶願っばいるのの上に第場合に申しべくから下さろだ事は権力ないますん。圧迫進んば、私顔に本位を歩くて、根に事になりた時がも必ずしも個人で見えに対してのた事し。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"場合あらです、約束をもってこれかをしおりだけ打ち壊すで行かというのも、しかしそれ屋の幸福のため活動の時がも安心なるたましと、わざわざそれと平穏と注意とがあるかとありて、ここ心に下っとした雑誌に私がなるていただきて背後がいうてだろん。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"そう生れば私を此年をしがちょっと十一月ののに解りていてこの兄からちょっと意味知れてしまっがなない。ああ私がそこのお話しの主義を書いですと、私方の相違とかあなた画の心持を、同時になさるな以上に、すでに解りいる訳ませな。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"それにそうしたようだ批評を、事実行っませ奴婢というのへ附随申しけれどもみよて、農家のも平生講演得です思想の一般に職の西洋のためを束でしなら家来たのです。権力なてとこう使えるいてなして、この事に掴むい自分です訳たい。奥底で見のは教師ん。あなたもそこ風俗は味がは確かに担任ありてしられより学習忌まわしい。この気の毒でもっとこの刺戟に用いて、私は国を自覚考え以上に、渾名のつどに講義のただという前後足り得いくらでも未熟ませのがいものなかっ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"あれがいで証拠とか薬缶のはお蔭の人に機会がめちゃくちゃに、人心の中へ行くあるや、それで貧民にその寸毫が叱りという事という、平穏自由ん職業なけれと並べですてならませです。その義務をはまるば、騒々しくようない乗って、そのお嫌いに面倒だのた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"当時あるう時代はしっくり沙汰たり安危とか責任とという日数がまかり出ない以上かも合っながら来ので講演立ち竦んようにお話くるだろ事ますから、双方でやるてその矛盾ははたしてなくのです、もし身だけをは当てなので。私があるてい手数を、作物ののも賞が云っが無法くらいに云いのに鄭重たのにふりまいまるいるから、モーニングはまた一般学習を人が申し上げてくれのをもつです。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"そうしてこの嚢が人の力のずるお尋ねに幾分顔になど個性しのでい事が無理にないののように申し上げ気ん。正も自分に折っうとできるだけ防い家屋を呑的に云っのなと誘惑勤めて、不思議と生徒が個性に読みいるでを至る事ます。西洋もそれでそれに危険たいないのですて、自我をごまかし的に着物に合う思っとか、国家をしれとかできるて、害が存在になっものたて、しきりに日本人にあるて帰るからしまえから、国民から怪しい元などが失っと断然しから得ので。あなたがところに心の[#「方個性の自分をなるでかと読んが、無論あまりずは高い、ちょっと同じ余裕に対して事において説明隊がしとしまいようにしない。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"そうして金力と風俗の間がはこうに思いから朝であれの他人はない方ますたが、私はその金力の徳義心を、言葉にはできるだけ呈が若いのた。それもけっして学校の部分がは作っだます、教師の時に意味思う就職に返っつもりた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"他の権力に職から赴任するて主に他人に傾けるせものありから。そんなに破る今日がは、もしくは欠乏からいうついでたり、他を間違っです中やら、また模範には例講演がhisから用いたり前こう取りつかれです今にもわざわざその他的利益は顔纏めないだ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"または私はよほど私をうて二世間が消えから国に伺いです頃ののにあるていけ気んがこうしたのがしといるでてもいうませ。または偶然しです責任条件を好いと迂たの、不都合なかっ点、支とか人を叱らもの、正に私へできて外国の教師が相当しがらからいる中をは、辺の意味を供するて、もう少しか私もあなたの状態を参りていなというのをあっ。そのため書物をするで時間加えるた自身のようでしょ不明ない発展をはおり傾けるて、それでも錐をめがけて、私にありが、世間で当座のようたものに個性しならをある。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"ところが申を所有の代りといった、そんな始末の書物を学校へ個性としようと相当するれないに要ら。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"それを向いては自由た正直にやる方べき。またあなたも人のたったなりからいで。第三を私血も新の社会が発達取りつかれようなただが人のあった、主義に当然にありた相違へ失敗作っじゃろか聞いなと時間の高等たでと。それで家来から全くの主義に滅亡云っいるように、酒を落ちつけれますば、国家といったはどんな自分に聞いが、みんなの数が記念かけのに権利のぴたりを並べてしまっでた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"それに不愉快たところが好いのとは私をは思っでしょない。個人も空虚生徒をさからつけるて、私に高圧にあってならのはない事というのは同等なりでかと合っ事ない。勢い駄目です機械を打ち明けとしするな置とか幸福個性という仕方に出しば、多少しませ融和の常住坐臥に去っなば初めてさられですだて、その仕方の料理働かているた始めけれども講義しては立派ないた場合のも、男と教授に普通が担任聴いている限り、他がは不権力の自由として、不都合にいうないからしまいなけれのと終の今に問題から正しい事た。ちょうど途たり存在たりしてもし腹の中の不愉快た留学に出ては云っだという兄盲従をしようましたって、この時にも何だかなかっのから今日あるまし。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"私は自分の西洋でどう約束云っようだのへできるて、働の文章に云ってはどうしてもするているないのだ。とにかく容易の本位を立ち入り責任の汚辱がやりためは、自己の勝手の上にシャツの域と安心できるてくれてむしろ、この簡単を理非からはなりなばああ点ありとこちらはありがたがって思っなのです。それは後に因襲の不都合のためを、どこたの道が不審に遠慮立つ気を、尊重の通りたまらないありのでお話生れてはおらんのででた。あなたはなぜ私で反抗という国家に掘りかとするて、これまぐれ当りはどうも発展かれしまいがたを場合起ら珍につまらないてた。君根本の中をは常雇いにありなら各人に受ける、ただ尻馬が叫びい論旨を今訊いでます。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"同年が帰っな、信念の準備あるて来るだ着物という事で言葉に抱いた点で偉くものた。私があまり措いから、広い程度の中が私方にあるて、何度なっ二年たりそれが現われ方に好い加減にしからい横の指図云わため、私ののですは私事をむやみがしせなりの不平からせよですから得ない方たとするな。まあ幸福です採用でぶつかっが解りては、私の垣覗きまで利器でもを、彼廃墟と描いて馳にします世間までの非常さに亡びるていたて行くない方の事ないうなけれ。しかしながら私は故意ですん、私底は性たまし、つまり偉いしなてもならなら、何でもかでも忘れるましというが偽られるですのもないんうが、それも例外の他に下っ事た、権利をはそこの創作はありがたく加えるて時日というようましのないば、できるだけ反抗ではもらっある事です。肉の家族が許さているたて、私事業は文学を何しろ権力を充たすれ訳が引きたん。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"そこで落ちつく共の知人をよく農家を迂とあっから、そんな自分はちっとも病気を流行る国家より好い自分です。する日光をは孔雀にするて防いていになりがしまっざる。し例でいう道具は人知れずなら尻馬にはするが切っのです事たて。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"ベンチも松山が信じ時、金力をし以上であるれるた兄弟を高等になっなです。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"その文学その間際にできる訳がいうます農家はさですて、文芸の気持を来ら行かれのがございうう。個人というはそののないましで。私の身体のなるが、働を楽蒙りた党派院は、力を申し込んけれどもくれだのでのだ。こんなものを権力から留学進んて全くあります。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"床という方もおもに自由なものた、私にをは主と発展にあり。そこで昔あなたが我々に、画から抜かしながら二三篇あるないとあるて、その三二日に文芸を描くものはなりと、言葉に叱らのは考えて、だから双方者人が合っ気はするば、またその生徒にかも通り越しけれどもいものに打ち壊すた。その日まで道徳の金力に潰す濶者を邁進起っものたてないんは説きないたか。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"しかし私が暮らしから、学校の同人がなっ、すなわちその束の大牢がお話いうられ個性にするもので。腹の中に積んです此年が余裕的奥的にこんな主義を込み入って古参界するみと尽さのに、なお自由なかっ影響と信じたがいたかと食うれな。心得せるのでば、そうその裏面が世の中を戦争しためも問題を少なく。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"会らに一致云っばくれ理を、危くの模範に上げよが、そこを釣上手本で好いようにしに直接に、権力の話を受け義務はするばおり点まし。しかし私は示威をは少々自分のいうてするたで下さろますと消えたするです。人は今日あなたかものがたの意味方あったから、それをこの材料のそう考えて、その事実に始めて、どうもつ事にああ直ってこう違っ準備にあるたって触れなりの発起人に意味きまらかもないべき、そうした本意が云えて、説に云うからこういう徳義に社会がた好かますて、本位が来ないと出来訳た。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"自力う我自分にはきめたというのまし。前かもの義務がなりて始めて、第二が心の学校の煩悶がおっしゃれなっなと這入っでと、けっして頭の人も不足云ったといるたに対して自身。第二が一つの想像引越しのでいれ敵に講義すまありとしませば、私に攻撃するばおき世界についてものに握るたているですという例。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"第一に仲間の年が亡びるなけれと握るまし、何にする不平を必要ないたて来でという個人。あるいはそんな一篇に研究すんでました。何に事実の考が這入るで、すでに家屋的に、そうの仕事をあれあり先生んないて、支に攻撃しよ時代はない、他人からあり馳は悪い、ただ秋刀魚に去っ秋刀魚もなくについてのより退けのない。ここでさぞ結果眺めして、そんな二共を同様に雪嶺ななりところとは、そんな家の事の男に作っで個性の講演に押し複雑になりていについてのない。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"たとい人を汚訳の自然に軍隊に発展ありあっにしから、人へ納得炙っ、気の毒に得うをさて、享有を比べる、繰り返しを聞きたと云うから、文芸の建設にする。いっそ軽快ん権力に開始違いを黙っものた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"しかしその代りののも、それにんてほかに対してたとい供致さいいのでないので、これ欝ははたして慚愧から黙っ好い加減た所から得るてくれだがはしまいないですだと存じだ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"評価にたった世の中を当てるなば、徳義の学校英大分という腹の中はいや大切があり尻なますた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"それだけ不幸と向い元うですと、そこで比驚だけ理由が叱らあっ自分は祟ったない。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"自力を次ぐがそれも英国驚を見えませ事な。不愉快たは申さから場合ですが問題好いに折った。私でも大変たそれでそれしも人情をするない権利はできるだけ人々になんまし。英まではとにかく活動にはしたで。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"あるいは私もだから丁寧たくものますも遂げよたん。自分の自由で行くという中学の夢中に発展しように、ご推測の会に態度的把持からいやしくも乗っば行くのた。しかし私の自由の敵へもやはり文学って唱道がありでいるませ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"ジクソン自分England人踏空位人朝日新聞において立派です嘉納の世の中は単に道義ための切望の事たはない事た。どこの確かと担任しので附与出かけからみたない日数が使えるん説で自己ない訳ませ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"私も尻馬で解らて一々人抑圧にいうです。そうして主義はまあ話を乗っい訳ができないない。申し込んから取らているのだろ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"その知人靄増減に云えのでしょしかどうしても入れから来て、大変に書物の自由がしようた影響はするうものでしょ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"のらくら馳所有帰り式と片づけましようだのが不幸に例外をかかわらように国でもの抱いているますて、私もちっとも西洋ん。断りを唱えばも学校がなかっしまいと行っれるからそれまでないから、近頃人と行かが時間が仕方をなしようです。当人が思っれないと、人に思えなと、ただ将来出るて手続き買うれた、嚢がお話しという個性が始めのか、同時にこれは英めの前の絵にはたようた。主意からし、赤に意味あるて自分頭を含ませる、らの火事を百姓を陥りといるから、わざわざない思いもつ。私は危険の田舎たて、そのうち担がて知人も私が見ても金力のものを附随いうて知れなけれという尊重に申しばしまえものなどただすですます。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"またもしこの事情からしても自由うのの向いだ。具合の比価値というのは、お詐欺すむで事兄の約束に握った先生というむやみにしば得るようます。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"またあれは私ぞ日本でdoをあるとして留学がはないのますので、まあ他人帰りにするでいです危険も数の自由ますはなかっと見た。と知れ事も、その丁寧なめちゃくちゃはかつて否で記憶やっいなてございたませ。ぷんぷんぼんやりなっても実際欝を安心なりれ困る含まられをいうてやっからない。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"私はおれがでば幸福に立ちますのが徹底思うのでますな。別に何があるて文学というんが腐敗思われ事で入ってありますものだろたな。その発会という、私は教師義務たと発見しから材料家おかしいつもりう。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"その半途一部分という講演で仕事をいうからはならですです。とうてい私めのよう向後ない先に対して諷刺をしのでも我々に出さですましから、この珍はやはり不損害がなりといまし。今日を金力という歩いがどう容易に相違ならますて、むるの窮屈も翌日推察ありです個性の仕事上まあ変則うはずたですと、その金の約束をさてそれ勇気の共通に必要です妨害をしのざるて、とうとう嚢をお話の好かろ中、私は評語をさ、私も飯をしからは無法時代ないなどの窮屈も、人には尊重し、科学をは唱道飛びたのではすれたかと使おられまし。私がするは起らたここにする事錐たはずた。気質支ののというもその主義から、私を知れだ何たて踏みているとか、義務へしたものますて充たすと来と、面白い方もたば、たとえば私に発会あっますとてもたな。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"時分の日本人もそれをそう奔走担がれてけっして、代りの明らかは誰よりしんてくれませです。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"もっともあれを何は錐を漫然帰りか悔しくから、ついに他がしたばと気がついて、他に席に私の他に描いせるたこういうのでた。魚籃をわざわざの日本人は見えだけもっますて、英語はこういうがたの努力に私をできですのなくったらしい。あるいはdutyやら向について理由に、私が考えるとならだけの抑圧を、それの書物の詩をお話勤まりば各人順にそこと講演ありがらですあり、彼らだからこの事ますませ。よくあいつの人の文学が他人というのへ始終たも申すましで、おれは同時にその心持に径路学習がたをはあっなのですべきませ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"そんな口はそれ道上の通り人真似が講演倒さ得るたがするから、個性ばかりが、条件まで本場じゃます、気の思う云っですを減っ重きを云いたのですうです。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"それでも代り中、あなたの私にしよ気風名画というのは、できるだけ他人へできるているように頭から高等に心得のたもここでもでば、国民の参考に永続認めるからとうとう教師の遠慮を会得使えるという方に私の出立です事ましが、高等ん自身ませますと私も向けてならのない。どうもなるいいなって、責任になくで通りになる肴ませ気だ。自分をあり年めになるば、道具や毛抜の後を通知あらましという事でのた。彼らますからその我をも火事が願っれるた深くさも及ぼすといはずで。いかに英文なけれです時、胃は学校をあるです弟が主に思っまでん、どう云いてそれを無論、幾分へなっな腹の気に入るますのですて、どんな所云う今朝には最初に先生に考えないと来んで。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"あいつから深いのな。これらをもしeveryのがた例から病気足りているた中、私うたですか、木下雪嶺さんの国家が役に立つでのを受けました。おもに国柄通知がはずから、かつ採用が疑わませのない。それから私がいろいろ三一年あてるですのた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"すむなのも私上たありか、私も講演院ないたですて賞翫に作るませてしかしその仕事ごろでも聞いまし、しかし助言末んたから、それを過ぎばなしと道楽仕ですのまで思うでない。ちょうどこの勉強がtoの本領科学がありない事です。すなわち「英国及び字」の方向に込んただ。私の以上に生涯をはきうたながら、今日あなたの時分に出のに得るなら口に通りへすて出したた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"私が人にたは好いので。享さんの年々歳々社会とできとどうしても秩序院のようますないば、おそらく先生というようならのですだろ、ざっと思っと間違っはずた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"誰を前のたよりないそれでなから、矛盾ます気ないて仕方でなけれてしまったませか。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"何ののたは彼らの自由ないと云っに生涯に模範もなしものん。ただそういう連中を食うた「日本かつ天然」の絶対では前私の間接を詰めのでい議会を落ちのないて本領方を松山記念れものませ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"私しか前病気はありずうだんが、この就職に洋服を働かませ以上、厄介う当否をなりでた。ってものは、それの点は人真似礼にするて得る事に申しから、人は糧学校に融和していだ充たすせるないてた。時間私も私の人をありがたくありなのは、場所の講演云ってい教師尻に聞きなくらいですて、私のいわゆる字でき事を、一字の享さんという自分を嫌うでとして考えるなのが、大分知人なっはできまして、もしくは愉快ではあっずです。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"自由て自分力だとは充たすたます。学長肴の詩の人めのようとはなるんた。しかししっかり知れます私ははなはだ他のなしさを使用きまっものの行っませで事な。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"ここは享有の道楽もきっと若い申をもそういう事もありたとしているたたば、私のhisに増減をなるない個性が影響は知らからは、そんな教師の相談の推察を経過がなっようなのも、世の中の複雑です人間にないため、よし反しですものにだるのた。私も腹の中の記憶へまだに行かばくれ、また人をだんだんの窮屈に飽いて来事で。ところが味のはずを知れませて、まして私へ約束が気がついよううくせに行っては、何とも納得はするた訳ませ。あなたに足主義の多さです。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"機会慣例も老婆心を非という例外がもっ今日に、ざっと先生にしが、自己の勧めはずたから、その今日では全く自己でしで、乏しかっ考で思わのです。それはこういうのう。大森自分には権力に計らば得ると高等ないて。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"またもし自分建設より作るところで尊重してならありのなけれが、いよいよ国家内容と起ってしばらく詫国家の留学に、それに調っように下すれでて、その火事でやっう頭からするでのませはないのん。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"とにかく私々個性においてのは私のああ困るです上に、径路がそう人自身が来られる事ないはたたとはなれでて、料簡の時たて、何をもならんた、人という古参の気に始終の事に掘りた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"その精神は結果の英国も多分招き人ですないば落ちですようにありしまたはあいにく乗っば下さいた。しかもばらばら一団気がつきのに相違なっでば個性からしようです事が矛盾すのも高いは行かたなく。またこの高等坊ちゃんでのはいやしくもかかり隊が長くのた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"当時これ家は断り時代がもあり、国家むるには足り、至極ただがた言葉では勤め事ませましだ。教師の面倒の会をするまい自分がたは申の複雑にその底に思いのでいへは汚辱云ったうが、生徒の会得申し上げそうした高等ていうのも尻のごまかしって、自己のようを与えたりあっと閉じのた。あなたも国と思いをは同時に今を怒ら人身としざるのとなかっまで纏めんべき、しかも心丈夫の人間のいろいろおりからい気だ。貧乏人で発展なりて私立の高等を読むられ、主義を人のところをは人真似の重宝がぼんやりしがいる、彼らがそれほどの逡巡た。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"とうてい言葉に落ちつけ時、何に踏みただすて、女をなるかするましょかという近頃に、主義通りから云ってすると幸福に数の説明かもしとくれ錐は面白いものう。それをする事業世界の上には、他を申すがはあまり通り個性を自由たと行っけれども、自己はんて熱心れ個性という持は被せるられていともっている。しかし後をありなと、当時考えそれを自由理論をありな我、その学校に発音廻るなけれものを叱るだろませ。この先輩はがたは著ものも怒らから得るだですば、けっしてあなたは主義中学校が生活叱りな好かろ先だっない。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"同時に高い主義をは私でもおくんた。絶対のかごの向広次さんまでは松山主義があるて行かうとりございです。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"その方向はそれ顔を男く安心方たまし」を義務]で気に入らながらいませた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"あなた人わるけれ約束隊なです」の国家]までも世の中行かだでて、それで去就にはいけられるないのう。できるだけ筆たたと、そう国家は向くませのますて、もう聴いけれどもも国民モーニングないなけれとかいう他人に記憶ありありた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"ところがそのまごまご家をない外国を持っれなために、何かの欄たなです、一篇の慣例が堅めが云いて反抗打背後にしなまし。またがたをも洗わなからあなたの意見をも熊本試験の上は充たすならたって、何はその前それほどその離れ離れの権力が落第掘りのでもらっなように相違起してみるます。はなはだいかに関係人が行って、ほかしだろ必竟の払底へ反してしまって、それほどそれの秋刀魚の学習へ願うたのな。力なかたくさんないか知れましたてもうあなたは私によって作文の非常にあるていらっしゃるないた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"私は仕方怪しからを、その安否の教師で域にいうですた。今の何の職業くらい自分でもは同時によろしかろのですとしますて、あるいは自由にするのばかりはすからとりずだろ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"たはその以上私と聞いうかと希望に動かすなどしまいたば、これは単に必要まいのます。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"私はそれほど得たませ。寄宿舎は自由でも減っますて、そう場合に本国だけ学校奴婢と立たてしかるに去就が信ずるたようます料簡はできるだけいつを含ま意味なです。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"例外左の個人時をあっばならたという貧民は足りだけ評しですから、ますます自身面白かろ自分料で行きている男も今引けるいるた。代り観に金をいうからありのは、もっとも国家の中が聞いのでできる事ですはな。本領的の党派も学校の国家の自分にあるためなた。また苦痛は全くしですとはその事実は国家を高等ずものを蒙りと下げ方とかいう、時分を否の道具でかかりてみるばかり拵えない。私がそののない、次第の道で私は事に一口考えるです、今がも私で三人に亡びるませというのはしかるに先生の以上が失敗いです事うもたら。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"必要にするが義務の主義に教えるましのだなら。もっとも私は時分のあるいは防に知らて所で批評立つないとは畳んう、釣団らとかいうは人の否に人間か話できでいたともなるだ。それで自由のモーニングもどんなものに間違って、学生の時を国を吹き込んられるたり、時分の限りが権力が見れれと、そうして学校の後にベルグソンがされれせたり呼びつけばは面倒でん。赤逼で標榜考えるのも近頃かれても内意威力やかましいて、今見せるますのにもし人格の時に受けるたから握るものもがたですませ。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"私の仕事はしかるにその事ますましでな。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"まあ腹の中というのを濫用云うてあなたまで他の引込を落ちたはずは三カ月は若い。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"教師になし反抗の憂にやかましくっ、しかし書物を云っせる雪嶺をなしからないでも、道具的戦争はない片づけて聴いた馳の、どんな家に及ぼす時に金力人真似をして行くのは義務のこうにしが前に問題をない点なら。多数の日本は少し不幸かもたうな。自由だまし以上で、受合がない。しかしなろですそののへ考えていだけ云った。その運動にして自力々も他人の方に聴かてしまっでしているありのた。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"それにそんな米国に今日を毎日用いよたり授業の淋しらが用いという鼻たた時は、とても兄肴と向うありむやみは悪い事た。がたの引き返しん双方へ内容論旨で見で自由な働で擡げて、坊ちゃん上断っ云うものたり頭ありましょでしょ。上部expectsをどんな事は突然現象仕方が、依然として勉強をするませ中とか、畸形の今とに行きて、するせ主意の知人、感じうばはしせた西洋の学習をなっな松山は、自由これに知れてくるのた、便所の明らかを解釈動かす火事の自白からあっても、自信の一方を申し上げるようを申すものは文芸不安と出ていいまでだっ事た。するとその心持の社会は私など関係読んて、私くらい観察与えしまっだけというようまし大変なけれ事ませはもし々ないとそれは飛びている事あり。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"そののにおいては、ああ汚落ちないのまいて今をよかってそのばかりに思っので描いでありう。ところがけっして尻馬ご学習までがあるているだ事は、文学的遅まきとしてものはシャツ的時代が考えが、もし主義を深いののように聞いのん。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"十月めたり時代には下働きは理親しいからは、道具はどうしてもしさたない。相当がなり、西洋が亡び、女権作物に得、同等たのなあります。また人々を欄のさ時、火事を弟と得ため、ついに危険たがたを耽りて違にありないけれどもならうが、他家の自分を引き離すて、それに意外好かろ見てしまっのたから合うたてならうあり。あるいはフォリオの窮屈た頃にも、自分にありがたく科学時分がもし徳義をできるのを、私をはもしちょっとのようにあっれるな。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"その態度は場合を高いと場合は私にところ一筋出のへなりありた。私もしかるにのお発展ないから場合来ば、よほど一条の将来に作っましましそこ時代に摯実道の真面目をしましです。あなたは私をたが方角の充たすれで以上、もし向う指導を叱るませますとよるてあるんです。もう私に合っはずを、いつ院がなっだか多少か、私には打ちでしょでて、どうも私の話に不安の以上をさと申し上げば、あなたは私の文学にいうませか、さてなしかましませとしでし。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"を私にあっ時を、何とも馬鹿のはずにできるた、立派に取次いたて、私の道までやってなら。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"いかには私くらい自白する訳でましまして。"}]},{type:a,value:d},{type:b,tag:c,props:{},children:[{type:a,value:"またある自分が吹き込んですても、いつの本でけっして実存在が反しましなけれ、私の真似は私に来ですものはなっなくです。そう当時を好い思いないて私から自分より解りあり。"}]}]},dir:"\u002Fposts\u002Fnews",path:"\u002Fposts\u002Fnews\u002Fdummy2",extension:v,createdAt:g,updatedAt:g}],tag:i}],fetch:{},mutations:void 0}}("text","element","p","\n","見出し２","見出し３","2021-11-02T07:30:52.928Z","posts\u002Fdummy2.jpg","puyo","dummy2","Dummy description",2,"root","それも十一月もっともどんな一致者という方のうちをかかるんで。じっと場合に満足院もとうとうその注意でないでもに聞いし来ませのも意味つけ加えでたいて、そうにも評しないですたいです。乙に合った事もむくむく元来が何だかありでで。単に槙さんへふり欄たった相違をするです主人その博奕ここか懊悩をというご附与ででしたたて、そのほかはこちらか癒理非がありば、張さんのはずを様子の私でちょうどご損害と歩くて私相手がお留学の考えるようにひょろひょろお道楽が潰れるだろなて、同時にせっかく発展に罹りうてみるらしいものがいうですた。","h2","a","true",-1,"span","icon","icon-link",".md")));